(562, 'Idősgondozási Önkéntes', '2025-04-10 08:14:35.342', 'https://res.cloudinary.com/ddjasa4hz/image/upload/v1739348774/h5zvbn2wjpkfr2gtswi2.jpg', 'Venia conservo odio casso cribro arma. Aestas venio statua aequitas odit. Speculum talis uberrime aer modi pecto arcus.\nFacilis appello cui praesentium cohors aer cuppedia umerus. Contigo val', 'Krisztian_Fazekas8', 17, 7, 'Veszprém', '2025-03-29 09:14:35.342'),
(563, 'Idősgondozási Önkéntes', '2025-05-26 08:14:35.342', 'https://res.cloudinary.com/ddjasa4hz/image/upload/v1739348774/h5zvbn2wjpkfr2gtswi2.jpg', 'Tero tutamen nobis sustineo solitudo. Adsidue curiositas illo suasoria. Articulus exercitationem sustineo sodalitas verbera ratione decerno sequi cibus deprecator.\nCoadunatio combibo appello ', 'Kolos36', 21, 17, 'Győr', '2025-02-19 09:14:35.342'),
(564, 'Katasztrófaelhárítási Önkéntes', '2025-05-23 08:14:35.341', 'https://res.cloudinary.com/ddjasa4hz/image/upload/v1739348774/h5zvbn2wjpkfr2gtswi2.jpg', 'Aegrus angelus subnecto trans deprimo sto perspiciatis. Minima ambitus similique aperio solitudo cohaero adipiscor. Cupiditas clementia causa ager defero vita.\nCeler a culpa decens. Soleo sub', 'Benedek.Sarkozi', 10, 5, 'Debrecen', '2025-02-23 09:14:35.341');
