(1, 'Hegedüs Csongor', 'Liza_Kovacs96', 'Aron14@freemail.hu', 'https://res.cloudinary.com/ddjasa4hz/image/upload/v1739348774/h5zvbn2wjpkfr2gtswi2.jpg', '$2b$10$ag0ULQekJnwejrykYW8AXur85huicuZT5poi2.LHl.FrOZsdU.gtK', 1, 'Cito volo deserunt decimus consequatur decor.\nCohors ait ter cur studio amplexus appositus velum.\nDicta uberrime tametsi.\nAperio delego vesper ultio peccatus brevis optio.\nDefendo cognatus ad', '2025-03-24 09:14:26.082'),
(2, 'Gál Attila', 'Dora.Mezei95', 'Zente.Fazekas23@hotmail.hu', 'https://res.cloudinary.com/ddjasa4hz/image/upload/v1739348774/h5zvbn2wjpkfr2gtswi2.jpg', '$2b$10$PuyGELUliRoD47DnZ.6fjuXNRgWZayn0IbOQDVeZEraju9r62zcA6', 0, 'Civis denuncio consequuntur aspicio aedificium tristis.\nNatus admoneo bonus dolorum subnecto defungo angulus.\nDelectatio tricesimus defendo spectaculum.\nDefaeco tonsor cimentarius ascisco adh', '2025-04-13 08:14:26.073'),
